import React from "react";

function Navbar(){

    return(
        <div>
            <span className="navlink">
                <a href="/account">My Account</a>
            </span>
            <span className="navlink">
                <a href="/signout">Sign Out</a>
            </span>
        </div>
    )
}


export default Navbar;
